import React from 'react';
import { Switch, Route } from 'react-router-dom';
import About from './About';
import Skills from '.Skills';
import WorkExperience from './WorkExperience';
import Portfolio from './Portfolio';

export default () => {
  return (
    <main>
      <Switch>
        {/* <Route exact path="/" component={Login} /> */}
        {/* need to edit this route for the add/manage lot page */}
        {/* <PrivateRoute exact path="/about" component={About} />
        <PrivateRoute exact path="/skills" component={Skills} />
        <PrivateRoute exact path="/experience" component={WorkExperience} />
        <PrivateRoute exact path="/portfolio" component={Portfolio} /> */}

        <Route exact path="/about" component={About} />
        <Route exact path="/skills" component={Skills} />
        <Route exact path="/experience" component={WorkExperience} />
        <Route exact path="/portfolio" component={Portfolio} />
      </Switch>
    </main>
  );
};
